import React from 'react';
import Head from 'next/head';
import { Layout } from 'containers';
import { GlobalStyles } from 'lib/globalStyle';

function MyApp({ Component, pageProps }) {
  return (
    <>
      <Head>
        <title>My site</title>
        <GlobalStyles />
      </Head>
      <Layout>
        <Component {...pageProps} />
      </Layout>
    </>
  );
}

export default MyApp;
